Its been raining for the past few days and thankfully my family and I can rely on the warm and nourishing soup from @laohuotanggroup to comfort us
.
They offer set menus to cater for 2 pax to 10 pax with a combination of soup, speciality, meat, fish, speciality and main. Soup wise, one can select from the likes of Pork Rib with Apple &amp; Snow Pear Soup, Lotus Root Soup with Peanut, Mummy’s ABC Soup and Gingko Nut Pork Tripe Soup
.
Besides their signature soup, one can also order ala carte their speciality, egg dishes, pork items, vegetables , prawn, noodle and rice. Featured here is their Apple &amp; Snow Pear Soup, Gingko Nut Pork Tripe Soup, Homemade Crispy Tofu with Minced Meat, Spinach with Salted Egg and Century Egg and my personal favourite Sweet and Sour Pork
.
