Channeling spring sass using all clean beauties from @barrymcosmetics_singapore 🦋 ·
Face: 
@barrymcosmetics_singapore 𝗡𝘆𝗺𝗽𝗵 𝗥𝗮𝗱𝗶𝗮𝗻𝗰𝗲 𝗦𝗲𝗿𝘂𝗺 ^* This oil based serum formulated with anti-inflammatory apricot oil, brightening papaya,
soothing tea tree oil primes your canvas for a dewy, radiant glow. 
𝗡𝘆𝗺𝗽𝗵 𝗥𝗮𝗱𝗶𝗮𝗻𝗰𝗲 𝗦𝗲𝗿𝘂𝗺 doubles up as a night treatment skincare and it’s been serving my dry-combination well 💛
@barrymcosmetics_singapore 𝗔𝗹𝗹 𝗡𝗶𝗴𝗵𝘁 𝗟𝗼𝗻𝗴 𝗠𝗲𝗱𝗶𝘂𝗺 𝗖𝗼𝘃𝗲𝗿𝗮𝗴𝗲 𝗙𝗼𝘂𝗻𝗱𝗮𝘁𝗶𝗼𝗻 𝗶𝗻 𝗠𝗶𝗹𝗸 ^* Probably one of the few drugstores foundation which checks the 3 B’s- blendable, buildable, breathable. This stick foundation is super creamy, pliable without leaving streaks or feeling caked after. 
Eyes:
@barrymcosmetics_singapore 𝗙𝗮𝗹𝗹 𝗜𝗻 𝗟𝗼𝘃𝗲 𝗜𝗜 𝗘𝘆𝗲𝘀𝗵𝗮𝗱𝗼𝘄 𝗣𝗮𝗹𝗲𝘁𝘁𝗲 ^* This palette screams versatility and I love it. Achieve your day, desk, dawn eyes with just one palette decked in 5 buttery pigmented mattes and metallics. 
@barrymcosmetics_singapore 𝗘𝘆𝗲 𝗗𝗲𝗳𝗶𝗻𝗲 𝗟𝗶𝗾𝘂𝗶𝗱 𝗘𝘆𝗲𝗹𝗶𝗻𝗲𝗿 𝗶𝗻 𝗕𝗹𝗮𝗰𝗸 ^*
One of my OG favourite in cocoa brown. If you are on the quest for a solid jet-black felt tip eyeliner? This fits the bill. 
