Just wow, on all counts. @laohuotanggroup truly deliver on all aspects- taste, speed, generosity. 
Chinese takeouts are never my go-to as they’re generally greasy, big on seasoning, high on sodium in my books which thankfully, @laohuotanggroup identified none with 💛
Favourites off gate
· 𝗣𝗿𝗲𝗺𝗶𝘂𝗺 𝗛𝗲𝗿𝗯𝗮𝗹 𝗣𝗿𝗮𝘄𝗻𝘀 (mad appreciation for deveined prawns!)
· 𝗦𝗽𝗶𝗻𝗮𝗰𝗵 𝘄𝗶𝘁𝗵 𝗦𝗮𝗹𝘁𝗲𝗱 &amp; 𝗖𝗲𝗻𝘁𝘂𝗿𝘆 𝗘𝗴𝗴 (@laohuotanggroup truly don’t skimp on the eggs)
· 𝗦𝗲𝗮𝗳𝗼𝗼𝗱 𝗛𝗼𝗿𝗳𝘂𝗻 𝘄𝗶𝘁𝗵 𝗘𝗴𝗴 𝗚𝗿𝗮𝘃𝘆 (the horfun (which packs a wok) came separately from the egg gravy. Talk about attention to detail shall we)
